import React from 'react';
import Footer from './Footer';
import Header from './Header';
import Wrapper from './Wrapper';
import './App.css';

function App() {
  return (
    <div className="App">

      <Header/>
      <Footer />  
      <Wrapper>
        <p>Her comes 4 divs</p>
      </Wrapper>
    </div>
  );
}

export default App;
